export default function SearchBar({onSearch}) {
   return (
      <div
         style={{
            display: 'flex',
            margin: 10,
            width: '100%',
            justifyContent: 'center',
         }}
         >
         <input 
            type='search' 
            placeholder='Introducir un termino...'
            style={{
               border: '5px black',
               borderRadius: '20px',
               width: '20%',
               backgroundColor: '#ffffffd7',
               color: 'black'
            }}
         />
         <button 
            style={{
               height: 40, 
               borderRadius: '20px',
               backgroundColor: '#ffffffd7',
               border:'5px black',
            }}
            onClick={() => onSearch(1)}
         >
            Buscar
         </button>
      </div>
   );
}
